import React from 'react';
import Tab, { ITabProps } from './tab';
import { StyledTabs, TabsNav } from './styles';

export interface ITabsProps {
  tabs: ITabProps[];
};

const Tabs: React.FC<ITabsProps> = ({ tabs }) => {
  return (
    <StyledTabs>
      <h2 className='visually-hidden'>Сервисы</h2>
      <TabsNav>
        {
          tabs.map((tab) => (
            <li>
              {tab.title}
            </li>
          ))
        }
        <li>
          Доставка
        </li>
        <li>
          Гарантия
        </li>
        <li>
          Кредит
        </li>
      </TabsNav>
      <Tab
        title='Доставка'
        text='Мы с удовольствием доставим ваш товар прямо к вашему подъезду совершенно бесплатно!
              Ведь мы неплохо заработаем, поднимая его на ваш этаж.'
      />
    </StyledTabs>
  )
};

export default Tabs;
